			.m-header {margin-top: 20px;}
			.m-other {margin-bottom: 50px;}
			.header-h {height: 80px;}
			.main-h {height: 500px;}
			.footer-h {height: 100px;}

			.z1 { z-index: 1; }
			.z2 { z-index: 2; }

			.abso {position: absolute;}

			@media screen and (max-width: 1350px)
			{
				.justify-flex-end {justify-content: flex-end;}
				.mobile {display: none;}
				.main-h {height: 600px;}
				.footer-h {height: 100px;}
