	/* EFFETS */  

	/***********************************************

						VIBRATE 1

	***********************************************/

			.vibrate-1 {
				-webkit-animation: vibrate-1 5s linear 2s infinite reverse both;
						animation: vibrate-1 5s linear 2s infinite reverse both;
			}
			
			@-webkit-keyframes vibrate-1 {
				0% {
				-webkit-transform: translate(0);
						transform: translate(0);
				}
				20% {
				-webkit-transform: translate(2px, -2px);
						transform: translate(2px, -2px);
				}
				40% {
				-webkit-transform: translate(2px, 2px);
						transform: translate(2px, 2px);
				}
				60% {
				-webkit-transform: translate(-2px, 2px);
						transform: translate(-2px, 2px);
				}
				80% {
				-webkit-transform: translate(-2px, -2px);
						transform: translate(-2px, -2px);
				}
				100% {
				-webkit-transform: translate(0);
						transform: translate(0);
				}
			}
			@keyframes vibrate-1 {
				0% {
				-webkit-transform: translate(0);
						transform: translate(0);
				}
				20% {
				-webkit-transform: translate(2px, -2px);
						transform: translate(2px, -2px);
				}
				40% {
				-webkit-transform: translate(2px, 2px);
						transform: translate(2px, 2px);
				}
				60% {
				-webkit-transform: translate(-2px, 2px);
						transform: translate(-2px, 2px);
				}
				80% {
				-webkit-transform: translate(-2px, -2px);
						transform: translate(-2px, -2px);
				}
				100% {
				-webkit-transform: translate(0);
						transform: translate(0);
				}
			}
			

	/***********************************************

						ROTATE

	***********************************************/


			.rotate {
				
				transform-origin: 50% 50%;
				}
				
				@-webkit-keyframes spin {
				from{
				-webkit-transform: rotate(0deg);
				}
				to{
				-webkit-transform: rotate(360deg);
				}
				}
				
				.spin {
				-webkit-animation: spin 15s linear infinite;
				}

	/***********************************************

						VIBRATE 2

	***********************************************/


			.vibrate-2 {
				-webkit-animation: vibrate-2 3s linear 1s infinite alternate forwards;
						animation: vibrate-2 3s linear 1s infinite alternate forwards;
				}

			@-webkit-keyframes vibrate-2 {
				0% {
					-webkit-transform: translate(0);
							transform: translate(0);
				}
				20% {
					-webkit-transform: translate(2px, -2px);
							transform: translate(2px, -2px);
				}
				40% {
					-webkit-transform: translate(2px, 2px);
							transform: translate(2px, 2px);
				}
				60% {
					-webkit-transform: translate(-2px, 2px);
							transform: translate(-2px, 2px);
				}
				80% {
					-webkit-transform: translate(-2px, -2px);
							transform: translate(-2px, -2px);
				}
				100% {
					-webkit-transform: translate(0);
							transform: translate(0);
				}
				}
				@keyframes vibrate-2 {
				0% {
					-webkit-transform: translate(0);
							transform: translate(0);
				}
				20% {
					-webkit-transform: translate(2px, -2px);
							transform: translate(2px, -2px);
				}
				40% {
					-webkit-transform: translate(2px, 2px);
							transform: translate(2px, 2px);
			}
			60% {
				-webkit-transform: translate(-2px, 2px);
						transform: translate(-2px, 2px);
			}
			80% {
				-webkit-transform: translate(-2px, -2px);
						transform: translate(-2px, -2px);
			}
			100% {
				-webkit-transform: translate(0);
						transform: translate(0);
			}
			}
			
/***********************************************

                    TEXT

***********************************************/

		.text-focus-in {
			-webkit-animation: text-focus-in 3s cubic-bezier(0.550, 0.085, 0.680, 0.530) both;
					animation: text-focus-in 3s cubic-bezier(0.550, 0.085, 0.680, 0.530) both;
		}

		@-webkit-keyframes text-focus-in {
			0% {
			-webkit-filter: blur(12px);
					filter: blur(12px);
			opacity: 0;
			}
			100% {
			-webkit-filter: blur(0px);
					filter: blur(0px);
			opacity: 1;
			}
		}
		@keyframes text-focus-in {
			0% {
			-webkit-filter: blur(12px);
					filter: blur(12px);
			opacity: 0;
			}
			100% {
			-webkit-filter: blur(0px);
					filter: blur(0px);
			opacity: 1;
			}
		}
  

