******************************************************************************************* -->

<?php

$mail_html = '';
// Import PHPMailer classes into the global namespace
// These must be at the top of your script, not inside a function
use PHPMailer\PHPMailer\PHPMailer;
use PHPMailer\PHPMailer\Exception;

//Load Composer's autoloader
require 'vendor/autoload.php';

$mail = new PHPMailer(true);                              // Passing `true` enables exceptions
try {
    //Server settings
    $mail->SMTPDebug = 0;                                 // Enable verbose debug output
    $mail->isSMTP();                                      // Set mailer to use SMTP
    $mail->Host = 'smtp.gmail.com';  // Specify main and backup SMTP servers
    $mail->SMTPAuth = true;                               // Enable SMTP authentication
    $mail->Username = 'abouhand@gmail.com';                 // SMTP username
    $mail->Password = 'Grigridu21';                           // SMTP password
    $mail->SMTPSecure = 'ssl';                            // Enable TLS encryption, `ssl` also accepted
    $mail->Port = 465;                                    // TCP port to connect to

    //Recipients
    $mail->setFrom('abouhand@gmail.com', 'Alexandre BOUHAND');
    $mail->addAddress($_POST['mail']);     // Add a recipient
  

    $file = fopen('index.html', 'r');
while ($ligne = fgets($file)){
$mail_html .= $ligne;
}

    //Content
    $mail->isHTML(true);                                  // Set email format to HTML
    $mail->Subject = 'Je vous souhaite de bonnes vacances';
    $mail->Body    =  $mail_html;

    $mail->AltBody = '';

    $mail->send();
